import React from "react";
import "./App.css";

const Card = ({ planet }) => {
  return (
    <div className="card">
      <h2>{planet.name}</h2>
      <p>Climate: {planet.climate}</p>
      <p>Population: {planet.population}</p>
      <p>Terrain: {planet.terrain}</p>
    </div>
  );
};

export default Card;
